import { Container } from '@mui/system'
import { useEffect,useState } from 'react';
import { useSelector } from 'react-redux';
import { Button, Card, Grid } from '@mui/material';
import { useNavigate, Outlet, useLocation } from 'react-router-dom';
import axios from 'axios'

function Subscriptions() {
  const navigate = useNavigate();
  const members = useSelector((state) => state.members);
  const subscriptions = useSelector((state) => state.subscriptions);
  const movies = useSelector((state) => state.movies);

  const location = useLocation();
  const [selectedMember, setSelectedMember] = useState(null);

  const handleSubscribe = (member) => {
    setSelectedMember(member);
    const isSubscribeToNewMovie = location.pathname === "/mainPage/subscriptions/membersData/subscribeToNewMovie";
    if (isSubscribeToNewMovie) {
      navigate("/mainPage/subscriptions/membersData");
    } else {
      navigate('subscribeToNewMovie', { state: { member } });
    }
    // location.pathname === "/mainPage/subscriptions/editMember/subscribeToNewMovie" ? "Close" : "Subscribe to new movie"

  };
  const DeleteUser = async (memberID) => {
    //delete in DB 'http://localhost:8000/members'
    await axios.delete(`${'http://localhost:8000/members'}/${memberID}`);
    window.location.reload();
  }

  return (
    <Container>
      <h3>Subscriptions</h3>
      <Button sx={{ padding: 1, marginTop: 2 }} variant="outlined" size="small" type='submit' color="primary" onClick={() => navigate(`membersData`)}>All Members</Button>
      <Button sx={{ padding: 1, marginTop: 2, marginLeft: 2 }} variant="outlined" size="small" type='submit' color="primary" onClick={() => navigate(`addNewMember`)}>Add Member</Button>
      <Container sx={{ marginTop: 5 }}>
      <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }}>
        {
          members.map((member) => {
            return (
              <Card sx={{ width: 500, padding: 1, margin: 2, background: '#eeeeee' }} elevation={3}>
                <h2>{member.name}</h2>
                Email: {member.email}<br /><br />
                City:{member.city}<br /><br />
                <Button sx={{ padding: 1, marginTop: 2 }} variant="outlined" type='submit' onClick={() => navigate('/mainPage/subscriptions/editMember', { state: { member } })}>Edit</Button>
                <Button sx={{ padding: 1, marginTop: 2, marginLeft: 2 }} variant="outlined" type='submit' onClick={(e) => DeleteUser(member._id)}>Delete</Button>

                <Card sx={{ width: 450, padding: 1, margin: 2, background: '#eeeefff' }} elevation={3}>
                  <h4>Movies watched</h4>
                  <Button sx={{ padding: 1 }} size='small' variant="outlined" type='submit' onClick={() => handleSubscribe(member)}>Subscribe to new movie</Button>
                  <br /><br />
                  {selectedMember && selectedMember._id === member._id && <Outlet />}

                  <ul>
                    {
                      subscriptions.filter(x => x.memberId === member._id).map(item => {
                        return <div key={item._id}>      
                            {
                              movies.filter(mov=>mov._id===item.movies.movieId).map(movie=>{
                                return <li key={movie._id}> 
                                  {movie.name}
                                </li>
                              })
                            }
                        </div>
                      })
                    }
                  </ul>
                  list
                </Card>
              </Card>
            );
          })
        }
      </Grid>
 </Container>
    </Container>
  );
}

export default Subscriptions;
